export const fetchData = async (fileName) => {
    try {
      const response = await fetch(`src/components/GDDataJSON/Fall2020.json`);
      const jsonData = await response.json();
      return jsonData;
    } catch (error) {
      console.error('Error retrieving data:', error);
      return null;
    }
  };
